import React from "react";
import QuestionCard from "lutrivia/src/components/QuestionCard.js";

const QuestionContainer = (props) => {
  let renderQuestions = props.questions.map((question) => {
    return <QuestionCard text={question.text} answer={question.answer} />;
  });

  return <ul>{renderQuestions}</ul>;
};

export default QuestionContainer;
